consoleText(["Hello, i'm Panagiotis Kontos", "I'm a professional Software Developer", 'This is my portfolio.','Press Start'], 'text',['white','#d3ad7f','white','#d3ad7f']);

function consoleText(words, id, colors) {
  if (colors === undefined) colors = ['#fff'];
  var visible = true;
  var con = document.getElementById('console');
  var letterCount = 1;
  var x = 1;
  var waiting = false;
  var target = document.getElementById(id)
  target.setAttribute('style', 'color:' + colors[0])
  window.setInterval(function() {

    if (letterCount === 0 && waiting === false) {
      waiting = true;
      target.innerHTML = words[0].substring(0, letterCount)
      window.setTimeout(function() {
        var usedColor = colors.shift();
        colors.push(usedColor);
        var usedWord = words.shift();
        words.push(usedWord);
        x = 1;
        target.setAttribute('style', 'color:' + colors[0])
        letterCount += x;
        waiting = false;
      }, 1000)
    } else if (letterCount === words[0].length + 1 && waiting === false) {
      waiting = true;
      window.setTimeout(function() {
        x = -1;
        letterCount += x;
        waiting = false;
      }, 1000)
    } else if (waiting === false) {
      target.innerHTML = words[0].substring(0, letterCount)
      letterCount += x;
    }
  }, 120)
  window.setInterval(function() {
    if (visible === true) {
      con.className = 'console-underscore hidden'
      visible = false;

    } else {
      con.className = 'console-underscore'

      visible = true;
    }
  }, 400)
}



// animation
// import image
const myImage = new Image();
// image source
myImage.src = 'data:image/jpeg;base64,'

myImage.addEventListener('load', function(){
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 760;
    canvas.height = 1090;      

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0,0, canvas.width, canvas.height)
    ctx.clearRect(0,0, canvas.width, canvas.height)

    let particlesArray = [];
    const numberOfParticles = 5000;
    
    // brightness values for each pixel
    let mappedImage = [];
    for (let y=0; y<canvas.height; y++){
        let row = [];
        for (let x=0; x<canvas.width; x++){
            const red = pixels.data[(y*4* pixels.width)+(x*4)];
            const green = pixels.data[(y*4* pixels.width)+(x*4+1)];
            const blue = pixels.data[(y*4* pixels.width)+(x*4+2)];
            const brightness = calculatebrightness(red, green, blue)
            const cell = [
                cellBrightness = brightness,
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    function calculatebrightness(red, green, blue){
        return Math.sqrt(
            (red*red)*0.299+
            (green*green)*0.587+
            (blue*blue)*0.114
        )/100;
    }

    class Particle {
        constructor(){
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            // how fast they fall
            this.velocity = Math.random()*0.5;
            this.size = Math.random()*2.5 + 1;
            // index of array can't have decimals
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }

        // reset to position 0 when down
        update(){
            // index of array can't have decimals
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            // pixel brightness recognition
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;

            this.y += movement;
            // -----------------------------------
            if (this.y >= canvas.height){
                this.y =0;
                this.x = Math.random()* canvas.width;
            }
        }

        draw(){
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
            
        }
    }

    function init(){
        for (let i=0; i<numberOfParticles; i++){
            particlesArray.push(new Particle);
        }
    }
    init();
    function animate(){
        // fading trails
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'black'
        // cover the entire canvas
        ctx.fillRect(0,0,canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i=0; i<particlesArray.length; i++){
            particlesArray[i].update();
            // particles only to image
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate()
})